import React, { useState, useEffect } from "react";
import GolfDataService from "../../services/golf";
import "./nextTournament.css";
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

function NextTournament() {
  const [nextTournament, setTournament] = useState({});

  useEffect(() => {
    getTournament();
  }, []);

  const getTournament = () => {
    GolfDataService.getNextTournament()
      .then((response) => {
        setTournament(response.data);
      })
      .catch((e) => {
        console.log(e);
      });
  };

  return (
    
      <div className="componentContainer">
        
        <Container fluid>
          <Row>
            <Col>
            <h1>Next tournament..</h1>
              {nextTournament.Name}
            </Col>
          </Row>
          <Row>
            <Col>Algo Pick:</Col>
          </Row>
          <Row>
            <Col>Honorable Mentions</Col>
          </Row>
        </Container>
      </div>
    
  );
}

export default NextTournament;
